import React from "react";
import { Link, Route ,Switch } from "react-router-dom";
import "./PortfolioNav.css";
import WebProject from "../WebDevelopment/WebDevelopment"

const PortNav = props => (
  <div>
    <div className="navbar z-depth-3">
      <Link to="" role="button">{props.button1} </Link>{" "}
      <Link to="" role="button"> {props.button2}</Link>{" "}
      <Link to="" role="button"> {props.button3}</Link>{" "}

      <Switch>
      <Route exact path="/web" component={WebProject} />
      <Route exact path="/fashion" component={WebProject} />
      <Route exact path="/paint" component={WebProject} />
      </Switch>
    </div>

    {/* <Switch>
      <Route exact path="/web" component={WebProject} />
      <Route exact path="/webproject" component={WebProject} />
      <Route exact path="/development" component={WebProject} />

    </Switch> */}


  </div>
);

export default PortNav;
